body:
Fix for TS error "Cannot invoke an object which is possibly 'undefined'." on TypeScript 2.7.1. My test example was: 
```ts
const schema = Joi.object().keys({
    name: Joi.string().alphanum().min(3).max(20).required().error(new Error("Invalid name.")),
});
```

